import React from "react";
import './Circle.css';

function Circle(props){
    switch(props.rate){
        case "0" :
            return <div className="yellowCircle"></div>
        case "1" :
            return <div className="yellowCircle"></div>
        case "2" :
            return 
    }
    return (
        <>
        {props.rate}
        <div className="yellowCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        <div className="greyCircle"></div>
        </>
    )
}

export default Circle;
